import { StyleSheet} from 'react-native';
import * as Colors from "../../const/colors";
const backButtonStyles = StyleSheet.create({
    icon:{
        color:Colors.white,
        fontSize:24,
        textAlign:"left",
        paddingRight:10,paddingTop:5
    },
});
export {backButtonStyles};
